## Traffic Flow {#sec-epiflow}

:::{.p-3}
@fig-epiflowNetwork presents an intriguing bird's-eye view of trip behaviors through an interactive epiflow diagram. This visualization employs a network of nodes (circles) connected by lines, where the thickness of the lines roughly corresponds to the volume of trips between the nodes, with thicker lines indicating a higher number of trips. The top 34 most frequently traveled stations are depicted in this visual network diagram.

The interactive nature of the epiflow diagram allows users to click on individual nodes and lines to access more detailed information. Additionally, a drop-down window provides further exploration capabilities, enabling users to delve deeper into the data.

These stations represent the most active locations within the system. Fortunately, @sec-mapview explores a potential approach to gain insights into the typical high-traffic station locations and the underlying reasons behind their elevated activity levels.

[@moragab]
:::

